import { useDispatch } from "react-redux";
import { storeOrders } from "../actions/ordersAction";

function PlaceOrders({pname}) {
let dispatch = useDispatch();
    
let placeOrder = (pname)=> {
        console.log(pname)
        let orderDate = new Date();
        let order = {pname,orderDate}
        console.log(order)
        dispatch(storeOrders(order))
    }
    return(
        <>
        <a onClick={()=>placeOrder(pname)}>
<img src="data:image/png;base64," width="30px" height="30px"/>
             </a>
        </>
    )
}

export default PlaceOrders;